import React from 'react';
import {Link,Routes,Route} from 'react-router-dom';
import Weather from './Weather';

function App() {
  return (
    <div>
      <h1>주간날씨</h1>
      <hr />

      <nav>
        <Link to="/weather_get?id=mon">월</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=tue">화</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=wed">수</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=thu">목</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=fri">금</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=sat">토</Link>&nbsp;|&nbsp;
        <Link to="/weather_get?id=sun">일</Link>
      </nav>

      <Routes>
        <Route path="/weather" element={<Weather />} />
      </Routes>
    </div>
  );
};

export default App;
